function Article(props) {
    const {article} = props
    const body  = <section>{article.text}</section>
    return (
        <div>
            <h2>title</h2>
            {body}
            <h3>creation date: {(new Date()).toDateString()}</h3>
        </div>
    )
};


export default Article;
